<span class="t s9" style="left:1142px;bottom:320px;letter-spacing:-0.14px;">57,01 </span>
<span class="t sb" style="left:160px;bottom:361px;letter-spacing:-0.22px;word-spacing:0.16px;">Yer seimi ve faaliyet izin belgesi iin ara arj istasyonu alan ve istasyon nedeniyle faydalanlan alanlar toplam olacak ekilde her metrekare iin, </span>
<span class="t sb" style="left:160px;bottom:347px;letter-spacing:-0.22px;">-bykehirlerde, </span>
<span class="t sb" style="left:160px;bottom:321px;letter-spacing:-0.2px;word-spacing:0.15px;">-dier yerlerde, </span>
<span class="t sc" style="left:271px;bottom:855px;letter-spacing:0.14px;word-spacing:0.06px;">BELEDYELER TARAFINDAN MUHTELF KANUNLARCA UYGULANACAK PARASAL SINIRLAR VE DAR PARA CEZALARI </span>
<span class="t sa" style="left:456px;bottom:373px;letter-spacing:-0.19px;word-spacing:0.06px;">YER AMA VE ALIMA RUHSATLARINA LKN YNETMELK </span>
<span class="t sa" style="left:562px;bottom:519px;letter-spacing:-0.19px;word-spacing:0.06px;">3194 SAYILI MAR KANUNU </span>
<span class="t sa" style="left:549px;bottom:753px;letter-spacing:-0.19px;word-spacing:0.06px;">5393 SAYILI BELEDYE KANUNU </span>
<span class="t s9" style="left:467px;bottom:741px;letter-spacing:-0.2px;word-spacing:0.08px;">PARASAL SINIRIN KONUSU </span>
<span class="t sb" style="left:160px;bottom:698px;letter-spacing:-0.14px;">r) </span><span class="t sa" style="left:170px;bottom:698px;letter-spacing:-0.17px;word-spacing:0.09px;">(Ek: 12/11/2012-6360/18 md.) </span><span class="t sb" style="left:305px;bottom:698px;letter-spacing:-0.22px;word-spacing:0.16px;">Belediye mcavir alan snrlar ierisinde 5/11/2008 tarihli ve 5809 sayl Elektronik Haberleme Kanunu, 26/9/2011 tarihli ve 655 sayl </span>
<span class="t sb" style="left:160px;bottom:685px;letter-spacing:-0.24px;word-spacing:0.17px;">Ulatrma, Denizcilik ve Haberleme Bakanlnn Tekilat ve Grevleri Hakknda Kanun Hkmnde Kararname ve ilgili dier mevzuata gre kurulu izni verilen alanda tesis </span>
<span class="t sb" style="left:160px;bottom:671px;letter-spacing:-0.21px;word-spacing:0.15px;">edilecek elektronik haberleme istasyonlarna kent ve yap estetii ile elektronik haberleme hizmetinin gerekleri dikkate alnarak cret karlnda yer seim belgesi vermek, </span>
<span class="t sd" style="left:160px;bottom:658px;">... </span>
<span class="t sb" style="left:160px;bottom:644px;letter-spacing:-0.21px;word-spacing:0.15px;">(Ek fkra: 12/11/2012-6360/18 md.) (r) bendine gre verilecek yer seim belgesi karlnda alnacak cret Ulatrma, Denizcilik ve Haberleme Bakanlnca belirlenir. creti </span>
<span class="t sb" style="left:160px;bottom:631px;letter-spacing:-0.25px;word-spacing:0.19px;">yatrlmasna ramen yirmi gn ierisinde verilmeyen yer seim belgesi verilmi saylr. Bykehir snrlar ierisinde yer seim belgesi vermeye ve cretini almaya bykehir </span>
<span class="t sd" style="left:160px;bottom:618px;letter-spacing:-0.22px;word-spacing:0.17px;">belediyeleri yetkilidir. </span>
<span class="t sb" style="left:160px;bottom:570px;letter-spacing:-0.22px;word-spacing:0.16px;">h) Vergi, resim ve harlar dnda kalan ve miktar bebin YTL'den fazla dava konusu olan belediye uyumazlklarn sulh ile tasfiyeye, kabul ve feragate karar vermek. </span>
<span class="t sb" style="left:160px;bottom:544px;letter-spacing:-0.23px;word-spacing:0.17px;">f) Vergi, resim ve harlar dnda kalan dava konusu olan belediye uyumazlklarnn anlama ile tasfiyesine karar vermek. </span>
