<span class="t sa" style="left:191px;bottom:637px;letter-spacing:-0.19px;word-spacing:0.05px;">1608 SAYILI UMURU BELEDYEYE MTEALLK AHKMI CEZAYE HAKKINDA 16 NSAN 1340 TARH VE 486 NUMARALI KANUNUN BAZI MADDELERN MUADDL KANUN </span>
<span class="t sa" style="left:384px;bottom:623px;letter-spacing:-0.2px;word-spacing:0.09px;">KABAHATN ADI </span>
<span class="t sb" style="left:160px;bottom:580px;letter-spacing:-0.24px;word-spacing:0.18px;">Belediye meclis ve encmenlerinin kendilerine kanun, nizam ve talimatnamelerin verdii vazife ve salahiyet dairesinde ittihaz </span>
<span class="t sb" style="left:160px;bottom:567px;letter-spacing:-0.24px;word-spacing:0.18px;">ettikleri kararlara muhalif hareket edenlerle belediye kanun ve nizam ve talimatnamelerinin men veya emrettii fiilleri </span>
<span class="t sb" style="left:160px;bottom:553px;letter-spacing:-0.24px;word-spacing:0.17px;">ileyenlere veya yapmayanlara </span>
<span class="t sb" style="left:160px;bottom:536px;letter-spacing:-0.24px;word-spacing:0.18px;">Belediyelerin karar organlar veya ilgili komisyonlar tarafndan mevzuata uygun olarak belirlenen yolcu nakil aralarna ilikin </span>
<span class="t sb" style="left:160px;bottom:523px;letter-spacing:-0.24px;word-spacing:0.17px;">cret tarifelerine uymayan kiiye </span>
<span class="t sa" style="left:498px;bottom:492px;letter-spacing:-0.19px;word-spacing:0.06px;">2559 SAYILI POLS VAZFE VE SALAHYET KANUNU </span>
<span class="t sa" style="left:384px;bottom:478px;letter-spacing:-0.2px;word-spacing:0.09px;">KABAHATN ADI </span>
<span class="t sb" style="left:160px;bottom:435px;letter-spacing:-0.22px;word-spacing:0.17px;">Mevzuata aykr fiil ve davranlar </span>
<span class="t sa" style="left:372px;bottom:416px;letter-spacing:-0.2px;word-spacing:0.07px;">4207 SAYILI TTN RNLERNN ZARARLARININ NLENMES VE KONTROL HAKKINDA KANUN </span>
<span class="t sa" style="left:384px;bottom:402px;letter-spacing:-0.2px;word-spacing:0.09px;">KABAHATN ADI </span>
<span class="t sb" style="left:160px;bottom:359px;letter-spacing:-0.23px;word-spacing:0.17px;">Ttn rnleriyle ilgili izmarit, paket, azlk, kt ve benzeri atklarn evreye atlmas </span>
<span class="t s9" style="left:534px;bottom:342px;letter-spacing:-0.21px;word-spacing:0.08px;">831 SAYILI SULAR HAKKINDA KANUN </span>
<span class="t sa" style="left:384px;bottom:327px;letter-spacing:-0.2px;word-spacing:0.09px;">KABAHATN ADI </span>
<span class="t sb" style="left:163px;bottom:284px;letter-spacing:-0.21px;word-spacing:0.14px;">me sular kaynaklarnda zarar verecek ve shhat artlarn bozacak ekilde tarla amak ve hayvan brakmak ve sulamak </span>
<span class="t sb" style="left:160px;bottom:271px;letter-spacing:-0.22px;word-spacing:0.17px;">belediye veya ihtiyar meclisleri tarafndan yasak edilebilir. </span>
<span class="t sb" style="left:160px;bottom:236px;letter-spacing:-0.24px;word-spacing:0.18px;">Kayna belediye snr dnda bulunan sularn kaynak ve yollarnn bakm, korunmas, shhat artlarna uygun bir halde </span>
<span class="t sb" style="left:160px;bottom:223px;letter-spacing:-0.23px;word-spacing:0.17px;">bulundurulmas ve idaresi iin belediyelerin alacaklar tedbir ve kararlara ve yedinci madde hkmlerine gre yasaklarna </span>
<span class="t sb" style="left:160px;bottom:210px;letter-spacing:-0.2px;word-spacing:0.13px;">aykr hareket edenler hakknda belediye ceza </span><span class="t sb" style="left:359px;bottom:210px;letter-spacing:-0.22px;word-spacing:0.16px;">vermek salahiyeti, belediye snrna bal olmakszn kaynaa kadar gider. </span>
<span class="t sb" style="left:160px;bottom:196px;letter-spacing:-0.25px;word-spacing:0.19px;">Birlik kurulmu ise bu selahiyeti birlik kullanr. </span>
<span class="t sa" style="left:526px;bottom:176px;letter-spacing:-0.19px;word-spacing:0.06px;">6301 SAYILI LE DNLENMES KANUNU </span>
<span class="t sa" style="left:384px;bottom:161px;letter-spacing:-0.2px;word-spacing:0.09px;">KABAHATN ADI </span>
<span class="t sb" style="left:160px;bottom:119px;letter-spacing:-0.26px;word-spacing:0.19px;">Bu Kanun hkmlerine muhalif olarak mstahdem ve iilerine le dinlenmesi yaptrmayan iveren veya iveren vekillerine </span>
<span class="t sb" style="left:160px;bottom:105px;letter-spacing:-0.21px;word-spacing:0.16px;">yz Trk Liras idar para cezas verilir. </span>
<span class="t sb" style="left:160px;bottom:92px;letter-spacing:-0.24px;word-spacing:0.17px;">Bu Kanunun 5 inci maddesine muhalif hareket eden iveren veya iveren vekiline, mstahdem veya ii kazanlarnn veya bu </span>
<span class="t sb" style="left:160px;bottom:78px;letter-spacing:-0.22px;word-spacing:0.16px;">kimselere ait sair haklarn daha aa hadlere indirilmesinden dolay mstahdem veya iilerin uradklar zararn iki kat kadar </span>
<span class="t sb" style="left:160px;bottom:65px;letter-spacing:-0.19px;word-spacing:0.14px;">idar para cezas verilir. </span>
<span class="t sb" style="left:160px;bottom:52px;letter-spacing:-0.23px;word-spacing:0.17px;">Bu maddedeki idar para cezalarn vermeye belediye encmeni yetkilidir. </span></div>

