<div class="text-container"><span class="t sk" style="left:555px;bottom:831px;letter-spacing:-0.08px;word-spacing:0.03px;">2025 YILINDA UYGULANACAK </span>
<span class="t sx" style="left:575px;bottom:818px;letter-spacing:-0.07px;word-spacing:0.03px;">DAR PARA CEZALARI </span>
<span class="t sk" style="left:615px;bottom:804px;letter-spacing:-0.07px;">TABLOSU </span>
<span class="t sy" style="left:396px;bottom:775px;letter-spacing:-0.05px;word-spacing:-0.12px;">Hkm Maddesi </span><span class="t sy" style="left:568px;bottom:775px;letter-spacing:-0.06px;word-spacing:0.02px;">Hkm Tanm </span><span class="t sz" style="left:723px;bottom:775px;letter-spacing:-0.05px;word-spacing:0.02px;">Ceza Maddesi </span><span class="t sy" style="left:813px;bottom:775px;letter-spacing:-0.05px;word-spacing:0.02px;">dari Ceza </span><span class="t sz" style="left:865px;bottom:775px;letter-spacing:-0.07px;">(TL) </span>
<span class="t sz" style="left:383px;bottom:752px;letter-spacing:-0.02px;">4.1.3 </span>
<span class="t sy" style="left:496px;bottom:759px;letter-spacing:-0.05px;word-spacing:0.02px;">Koruma altndaki yaban hayvanlarnn </span>
<span class="t sy" style="left:496px;bottom:745px;letter-spacing:-0.04px;">avlanmas, </span>
<span class="t sz" style="left:746px;bottom:752px;letter-spacing:-0.01px;">21/1 </span><span class="t sk" style="left:829px;bottom:752px;letter-spacing:-0.03px;">4.736,00 </span>
<span class="t sz" style="left:383px;bottom:721px;letter-spacing:-0.02px;">4.1.4.1 </span>
<span class="t sy" style="left:496px;bottom:724px;letter-spacing:-0.05px;word-spacing:0.02px;">Yaban hayvanlarnn reme, ty deitirme </span>
<span class="t sy" style="left:496px;bottom:710px;letter-spacing:-0.04px;">ve g dnemlerinde rahatsz edilmesi, </span>
<span class="t sz" style="left:746px;bottom:721px;letter-spacing:-0.01px;">21/1 </span><span class="t sk" style="left:829px;bottom:721px;letter-spacing:-0.03px;">4.736,00 </span>
<span class="t sz" style="left:383px;bottom:689px;letter-spacing:-0.02px;">4.1.4.2 </span>
<span class="t sy" style="left:496px;bottom:696px;letter-spacing:-0.05px;word-spacing:-0.03px;">Yaban hayvanlarnn yavru ve </span>
<span class="t sy" style="left:496px;bottom:682px;letter-spacing:-0.04px;word-spacing:-0.12px;">yumurtalarnn toplanmas, </span>
<span class="t sz" style="left:746px;bottom:689px;letter-spacing:-0.01px;">21/1 </span><span class="t sk" style="left:829px;bottom:689px;letter-spacing:-0.03px;">4.736,00 </span>
<span class="t sz" style="left:383px;bottom:667px;letter-spacing:-0.02px;">4.1.4.3 </span>
<span class="t sy" style="left:496px;bottom:665px;letter-spacing:-0.05px;word-spacing:0.02px;">Yaban hayvanlarnn yuvalarnn datlmas, </span>
<span class="t sz" style="left:746px;bottom:667px;letter-spacing:-0.01px;">21/1 </span><span class="t sk" style="left:829px;bottom:667px;letter-spacing:-0.03px;">4.736,00 </span>
<span class="t sz" style="left:383px;bottom:649px;letter-spacing:-0.02px;">4.1.4.4 </span>
<span class="t sy" style="left:496px;bottom:647px;letter-spacing:-0.05px;word-spacing:0.02px;">Memelilerin k uykusunda rahatsz edilmesi, </span>
<span class="t sz" style="left:746px;bottom:649px;letter-spacing:-0.01px;">21/1 </span><span class="t sk" style="left:829px;bottom:649px;letter-spacing:-0.03px;">4.736,00 </span>
<span class="t sz" style="left:383px;bottom:588px;letter-spacing:-0.02px;">4.1.5 </span>
<span class="t sy" style="left:496px;bottom:633px;letter-spacing:-0.05px;word-spacing:6.24px;">Lzumu halinde bu yaban hayvanlarnn </span>
<span class="t sy" style="left:496px;bottom:616px;letter-spacing:-0.05px;word-spacing:6.62px;">kendilerinden, yavru ve yumurtalarndan, </span>
<span class="t sy" style="left:496px;bottom:599px;letter-spacing:-0.05px;word-spacing:7.01px;">korunduklar sre iinde faydalanma ve </span>
<span class="t sy" style="left:496px;bottom:581px;letter-spacing:-0.04px;word-spacing:2.36px;">zararl olanlar ile mcadele ve men edilen </span>
<span class="t sy" style="left:496px;bottom:564px;letter-spacing:-0.05px;word-spacing:3.23px;">avlanma usulleri ile geici olarak avlanma </span>
<span class="t sy" style="left:496px;bottom:547px;letter-spacing:-0.05px;word-spacing:0.02px;">esaslarna uyulmamas, </span>
<span class="t sz" style="left:746px;bottom:588px;letter-spacing:-0.01px;">21/1 </span><span class="t sk" style="left:829px;bottom:588px;letter-spacing:-0.03px;">4.736,00 </span>
<span class="t sz" style="left:383px;bottom:461px;letter-spacing:-0.02px;">4.2 </span>
<span class="t sy" style="left:496px;bottom:529px;letter-spacing:0.04px;word-spacing:0.04px;">Koruma altnda olmayan yaban </span>
<span class="t sy" style="left:496px;bottom:516px;letter-spacing:0.06px;word-spacing:-0.05px;">hayvanlarnn avlanmann yasakland gn </span>
<span class="t sy" style="left:496px;bottom:502px;letter-spacing:0.06px;word-spacing:-0.01px;">ve srelerde; tarm alanlar ile besi ve yaban </span>
<span class="t sy" style="left:496px;bottom:489px;letter-spacing:0.05px;word-spacing:0.04px;">hayvanlarna zarar verecek sayda </span>
<span class="t sy" style="left:496px;bottom:475px;letter-spacing:0.06px;word-spacing:-0.09px;">oalmalar veya bulac hastalk </span>
<span class="t sy" style="left:496px;bottom:461px;letter-spacing:0.05px;word-spacing:0.01px;">tadklarnn tespiti durumunda, sz konusu </span>
<span class="t sy" style="left:496px;bottom:447px;letter-spacing:0.07px;word-spacing:-0.04px;">alanlarda konu mahall tarm ve kyileri ile </span>
<span class="t sy" style="left:496px;bottom:434px;letter-spacing:0.06px;word-spacing:-0.09px;">orman tekilt grevlilerince incelenerek </span>
<span class="t sy" style="left:496px;bottom:420px;letter-spacing:0.05px;word-spacing:0.01px;">hazrlanacak ortak rapor dorultusunda belli </span>
