<div class="text-container"><span class="t sz" style="left:383px;bottom:773px;letter-spacing:-0.02px;">4.5 </span>
<span class="t sy" style="left:496px;bottom:797px;letter-spacing:-0.05px;word-spacing:0.02px;">Yaban hayat koruma ve gelitirme sahalar </span>
<span class="t sz" style="left:496px;bottom:783px;letter-spacing:0.03px;">ile </span><span class="t sy" style="left:511px;bottom:783px;letter-spacing:-0.04px;word-spacing:-0.08px;">retme istasyonlar ve benzeri sahalarda, </span>
<span class="t sy" style="left:496px;bottom:769px;letter-spacing:-0.05px;word-spacing:0.02px;">bina ve tesislerin atklarnn artlmadan </span>
<span class="t sy" style="left:496px;bottom:756px;letter-spacing:-0.05px;word-spacing:-0.01px;">doal ortama braklmas nedeni ile yaban </span>
<span class="t sy" style="left:496px;bottom:742px;letter-spacing:-0.04px;word-spacing:-0.05px;">hayatnn veya ekosistemin olumsuz ynde </span>
<span class="t sz" style="left:496px;bottom:728px;letter-spacing:-0.05px;word-spacing:0.02px;">etkilenmesine sebebiyet verenlere ve tahrip </span>
<span class="t sy" style="left:496px;bottom:715px;letter-spacing:-0.04px;word-spacing:-0.02px;">edenlere fiilleri su oluturmad takdirde</span><span class="t sz" style="left:699px;bottom:715px;">, </span>
<span class="t sz" style="left:746px;bottom:773px;letter-spacing:-0.01px;">21/3 </span>
<span class="t sz" style="left:801px;bottom:793px;letter-spacing:-0.04px;word-spacing:0.14px;">09.08.1983 tarihli ve </span>
<span class="t sy" style="left:801px;bottom:780px;letter-spacing:-0.03px;">2872 </span><span class="t sy" style="left:835px;bottom:780px;letter-spacing:-0.07px;">sayl </span><span class="t sy" style="left:872px;bottom:780px;letter-spacing:-0.06px;">evre </span>
<span class="t sy" style="left:801px;bottom:767px;letter-spacing:-0.05px;">Kanunu </span><span class="t sy" style="left:851px;bottom:767px;letter-spacing:-0.06px;">hkmleri </span>
<span class="t sy" style="left:801px;bottom:754px;letter-spacing:-0.04px;">uygulanr. </span>
<span class="t sz" style="left:383px;bottom:584px;letter-spacing:-0.02px;">5.3 </span>
<span class="t sy" style="left:496px;bottom:701px;letter-spacing:-0.05px;word-spacing:0.02px;">Av ve yaban hayatnn korunmas, </span>
<span class="t sy" style="left:496px;bottom:687px;letter-spacing:-0.05px;word-spacing:-0.03px;">gelitirilmesi ve srdrlebilir ynetiminde; </span>
<span class="t sy" style="left:496px;bottom:673px;letter-spacing:-0.05px;word-spacing:0.01px;">kamuoyu desteinin salanmas iin </span>
<span class="t sz" style="left:496px;bottom:660px;letter-spacing:-0.05px;word-spacing:0.02px;">toplumun bilgilendirilmesi, </span><span class="t sy" style="left:629px;bottom:660px;letter-spacing:-0.04px;">bilinlendirilmesi </span>
<span class="t sy" style="left:496px;bottom:646px;letter-spacing:-0.04px;word-spacing:-0.04px;">ile avclarn ve toplumun eitilmesi </span>
<span class="t sy" style="left:496px;bottom:632px;letter-spacing:-0.04px;word-spacing:-0.02px;">amacyla; Trkiye snrlar iinde yayn </span>
<span class="t sy" style="left:496px;bottom:619px;letter-spacing:-0.04px;word-spacing:-0.01px;">yapan ulusal, blgesel, yerel radyo ve </span>
<span class="t sy" style="left:496px;bottom:605px;letter-spacing:-0.05px;word-spacing:0.02px;">televizyonlar; av sezonunun balamasndan </span>
<span class="t sy" style="left:496px;bottom:591px;letter-spacing:-0.04px;word-spacing:-0.03px;">onbe gn nce ve sona ermesinden itibaren </span>
<span class="t sy" style="left:496px;bottom:578px;letter-spacing:-0.04px;">de onbe gn sreyle eitici, uyarc ve </span>
<span class="t sy" style="left:496px;bottom:564px;letter-spacing:-0.05px;word-spacing:0.02px;">tantc yayn yapmak zorundadrlar. </span><span class="t sz" style="left:672px;bottom:564px;letter-spacing:-0.08px;">Bu </span>
<span class="t sy" style="left:496px;bottom:550px;letter-spacing:-0.04px;word-spacing:-0.04px;">yayn ve tantm faaliyetleri her kuruluun </span>
<span class="t sy" style="left:496px;bottom:537px;letter-spacing:-0.04px;word-spacing:-0.01px;">ana haber bltenlerinden sonraki kuakta ve </span>
<span class="t sy" style="left:496px;bottom:523px;letter-spacing:-0.05px;word-spacing:-0.01px;">cretsiz olarak yaynlanr. Bu programlarn </span>
