<div class="text-container"><span class="t sz" style="left:496px;bottom:831px;letter-spacing:-0.03px;">ticaretinden </span><span class="t sy" style="left:556px;bottom:831px;letter-spacing:-0.06px;word-spacing:0.03px;">Dner Sermaye letmesine gelir </span>
<span class="t sy" style="left:496px;bottom:817px;letter-spacing:-0.04px;word-spacing:-0.03px;">alnmas ile ilgili usul ve esaslara uymama, </span>
<span class="t sz" style="left:383px;bottom:687px;letter-spacing:-0.02px;">19 </span>
<span class="t sy" style="left:496px;bottom:769px;letter-spacing:-0.05px;">Kamu kurum ve kurulular ile gerek ve </span>
<span class="t sy" style="left:496px;bottom:756px;letter-spacing:-0.05px;word-spacing:0.02px;">tzel kiiler, av ve yaban hayvanlarndan </span>
<span class="t sy" style="left:496px;bottom:742px;letter-spacing:-0.04px;word-spacing:-0.02px;">Trkiye'de doal olarak yetien trleri </span>
<span class="t sy" style="left:496px;bottom:728px;letter-spacing:-0.04px;word-spacing:-0.01px;">Bakanlktan izin almak artyla retebilirler. </span>
<span class="t sy" style="left:496px;bottom:715px;letter-spacing:-0.05px;word-spacing:-0.03px;">Bunlarn doaya salnabilmesi iin </span>
<span class="t sy" style="left:496px;bottom:701px;letter-spacing:-0.04px;word-spacing:-0.02px;">Bakanlktan ayrca izin almak zorundar. </span>
<span class="t sy" style="left:496px;bottom:687px;letter-spacing:-0.05px;word-spacing:0.02px;">Yabanc trlerden Trkiye'nin uluslararas </span>
<span class="t sy" style="left:496px;bottom:674px;letter-spacing:-0.05px;word-spacing:0.02px;">ykmllkleri erevesinde ve doal </span>
<span class="t sy" style="left:496px;bottom:660px;letter-spacing:-0.05px;word-spacing:0.02px;">trlerimize zarar vermeyecek ola </span>
<span class="t sy" style="left:496px;bottom:646px;letter-spacing:-0.04px;word-spacing:-0.03px;">nlarnn ithalatna ve retimine, ilgili kurum </span>
<span class="t sy" style="left:496px;bottom:633px;letter-spacing:-0.05px;word-spacing:0.02px;">ve kurulularn grleri alnarak Bakanlka </span>
<span class="t sy" style="left:496px;bottom:619px;letter-spacing:-0.04px;word-spacing:-0.05px;">izin verilebilir. Bakanln koyaca esaslara </span>
<span class="t sz" style="left:496px;bottom:605px;letter-spacing:-0.05px;">uymayanlara, </span>
<span class="t sz" style="left:746px;bottom:687px;letter-spacing:-0.01px;">26/1 </span><span class="t sk" style="left:808px;bottom:687px;letter-spacing:-0.05px;">11.977-60.187,00 </span>
<span class="t sz" style="left:383px;bottom:571px;letter-spacing:-0.03px;">18.3 </span>
<span class="t sy" style="left:496px;bottom:591px;letter-spacing:-0.05px;word-spacing:-0.01px;">Yurt iinde sergilenmek zere veya gsteri </span>
<span class="t sy" style="left:496px;bottom:577px;letter-spacing:-0.05px;word-spacing:-0.03px;">amal olarak uluslararas szlemeler </span>
<span class="t sy" style="left:496px;bottom:564px;letter-spacing:-0.04px;word-spacing:-0.03px;">erevesinde ithalatna Bakanlka izin </span>
<span class="t sy" style="left:496px;bottom:550px;letter-spacing:-0.04px;word-spacing:-0.03px;">verilen yaban hayvanlarn satmak, </span>
<span class="t sz" style="left:746px;bottom:571px;letter-spacing:-0.01px;">26/1 </span><span class="t sk" style="left:826px;bottom:571px;letter-spacing:-0.03px;">72.252,00 </span>
<span class="t sz" style="left:383px;bottom:522px;letter-spacing:-0.01px;">21/5 </span>
